// source secrets.sh

import example from './disconnect.example.json'
import disconnect from './disconnect.js'

const { event, context } = example

disconnect
	.handler(event, context)
	.then(output => {
		console.log('DONE', JSON.stringify(output, undefined, 2))
		process.exit(0)
	})
	.then(error => {
		console.log('ERROR', JSON.stringify(error, undefined, 2))
		process.exit(1)
	})
